        public static void Run()
        {
            var coords = args.Split("\r\n")
                .Select(x => (x: int.Parse(x.Split(",")[0]), y: int.Parse(x.Split(",")[1]), z: int.Parse(x.Split(",")[2])))
                .ToArray();

            var minX = coords.Min(x => x.x);
            var maxX = coords.Max(x => x.x);

            var minY = coords.Min(x => x.y);
            var maxY = coords.Max(x => x.y);

            var minZ = coords.Min(x => x.z);
            var maxZ = coords.Max(x => x.z);

            bool[,,] arr = new bool[
                maxX - minX + 3,
                maxY - minY + 3,
                maxZ - minZ + 3];

            foreach (var c in coords)
            {
                arr[c.x - minX + 1,
                    c.y - minY + 1,
                    c.z - minZ + 1] = true;
            }

            List<(int, int, int)> lol = new List<(int, int, int)>();
            for (int x = 0; x < arr.GetLength(0); x++)
            {
                for (int y = 0; y < arr.GetLength(1); y++)
                {
                    for (int z = 0; z < arr.GetLength(2); z++)
                    {
                        if (arr[x, y, z] && (x == 0 || y == 0 || z == 0 ||
                            x == arr.GetLength(0) - 1 ||
                            y == arr.GetLength(1) - 1 ||
                            z == arr.GetLength(2) - 1))
                        {
                            lol.Add((x, y, z));
                        }
                    }
                }
            }

            int counter = 0;
            for (int x = 0; x < arr.GetLength(0); x++)
            {
                for (int y = 0; y < arr.GetLength(1); y++)
                {
                    for (int z = 0; z < arr.GetLength(2); z++)
                    {
                        //empty square
                        if (!arr[x, y, z])
                        {
                            continue;
                        }

                        var tmp = x - 1;
                        if (!arr[tmp, y, z])
                        {
                            counter++;
                            DecrementIfBlocked(arr, tmp, y, z, ref counter);
                        }

                        tmp = x + 1;
                        if (!arr[tmp, y, z])
                        {
                            counter++;
                            DecrementIfBlocked(arr, tmp, y, z, ref counter);
                        }

                        tmp = y - 1;
                        if (!arr[x, y - 1, z])
                        {
                            counter++;
                            DecrementIfBlocked(arr, x, tmp, z, ref counter);
                        }

                        tmp = y + 1;
                        if (!arr[x, y + 1, z])
                        {
                            counter++;
                            DecrementIfBlocked(arr, x, tmp, z, ref counter);
                        }

                        tmp = z - 1;
                        if (!arr[x, y, z - 1])
                        {
                            counter++;
                            DecrementIfBlocked(arr, x, y, tmp, ref counter);
                        }

                        tmp = z + 1;
                        if (!arr[x, y, z + 1])
                        {
                            counter++;
                            DecrementIfBlocked(arr, x, y, tmp, ref counter);
                        }
                    }
                }
            }

            Console.WriteLine(counter);
        }

        static HashSet<(int x, int y, int z)> blockedBubbles = new HashSet<(int x, int y, int z)>();

        static void DecrementIfBlocked(bool[,,] arr, int a, int b, int c, ref int counter)
        {
            if (blockedBubbles.Contains((a, b, c)))
            {
                counter--;
                return;
            }

            var visited = new HashSet<(int x, int y, int z)>();
            var q = new Queue<(int x, int y, int z)>();
            q.Enqueue((a, b, c));

            Console.WriteLine($"{DateTime.Now}: {a}, {b}, {c}");
            while (q.Count > 0)
            {
                var cur = q.Dequeue();
                visited.Add(cur);

                //found way out to the bound
                if (cur.x == 0 ||
                    cur.y == 0 ||
                    cur.z == 0 ||
                    cur.x == arr.GetLength(0) - 1 ||
                    cur.y == arr.GetLength(1) - 1 ||
                    cur.z == arr.GetLength(2) - 1)
                {
                    return;
                }

                var tmp = cur.x - 1;
                if (!visited.Contains((tmp, cur.y, cur.z)))
                    if (!arr[tmp, cur.y, cur.z]) q.Enqueue((tmp, cur.y, cur.z));

                tmp = cur.x + 1;
                if (!visited.Contains((tmp, cur.y, cur.z)))
                    if (!arr[tmp, cur.y, cur.z]) q.Enqueue((tmp, cur.y, cur.z));

                tmp = cur.y - 1;
                if (!visited.Contains((cur.x, tmp, cur.z)))
                    if (!arr[cur.x, tmp, cur.z]) q.Enqueue((cur.x, tmp, cur.z));

                tmp = cur.y + 1;
                if (!visited.Contains((cur.x, tmp, cur.z)))
                    if (!arr[cur.x, tmp, cur.z]) q.Enqueue((cur.x, tmp, cur.z));

                tmp = cur.z - 1;
                if (!visited.Contains((cur.x, cur.y, tmp)))
                    if (!arr[cur.x, cur.y, tmp]) q.Enqueue((cur.x, cur.y, tmp));

                tmp = cur.z + 1;
                if (!visited.Contains((cur.x, cur.y, tmp)))
                    if (!arr[cur.x, cur.y, tmp]) q.Enqueue((cur.x, cur.y, tmp));
            }

            foreach(var empty in visited)
            {
                blockedBubbles.Add(empty);
            }

            counter--;
        }
    }
}
